import styled from "styled-components"

const Content = styled.div`
    display: grid;
    grid-template-columns: 60% 40%;
    grid-template-rows: 11.4rem;

    grid-template-areas: 
    'header-left header-right'
    'left right'
`

const Head = styled.header`
    grid-area: header-left;
`
